КТО организует офисные часы?

Преподаватели курса отвечают за планирование времени проведения офисных часов.

КОМУ полезно посещать офисные часы?

Обучающиеся могут получить значительную пользу из посещения офисных часов, поскольку
это ценная возможность попросить преподавателей объяснить некоторые части материала курса ещё
раз, а также обсудить то, что было рассмотрено на занятиях, но показалось им непонятным.

ЗАЧЕМ посещать офисные часы?

● чтобы уточнить и задать вопросы по содержанию курса;
● чтобы получить советы по подготовке к определенному занятию;
● чтобы задать вопросы по силлабусу, предстоящим заданиям и срокам сдачи;
● обсудить идеи и ожидания профессора относительно предстоящего задания, проекта или

работы;

● проверить экзамен или работу, написанную ранее;
● поговорить об оценках;
● проработать практические задачи.

КОГДА посещать офисные часы?

Офисные часы назначаются преподавателем каждого курса индивидуально, либо в
определе

речи:

● Ведите себя уважительно. Не опаздывайте и представьтесь, если это ваша первая

индивидуальная встреча;

● Делайте заметки. Записывайте предложения, советы и комментарии, которыми делится

преподаватель;

● Просите разъяснений. Если вам трудно понять объяснения преподавателя, не стесняйтесь

попросить его повторить или дать альтернативное объяснение.

● Будьте честны. Попросите привести больше примеров, если вы все еще испытываете

трудности в понимании;

● Попросите дополнительные материалы для чтения или самообучения, которые могут помочь;
● Если вы не согласны с оценкой за экзамен или работу и хотите обсудить ее, вежливо спросите,
что было сделано неправильно или упущено, и примите к сведению совет, чтобы улучшить
свою следующую работу;

● Подведите итоги в конце встречи;
● Поблагодарите преподавателя за помощь и встречу с вами.

После встречи:

● Перечитайте записи, которые вы сделали во время офисных часов;
