WHY attend office hours?

● To clarify and ask questions about course content;
● To get study tips for a particular class;
● To ask questions about the syllabus, upcoming assignments, and due dates;
● To discuss ideas and professor’s expectations regarding an upcoming assignment, project or

paper;

● To review an exam or a paper written previously;
● To talk about grades;
● To work through practice problems.

WHEN to attend office hours?

Office Hours are scheduled by each course instructor individually, either at a set time each week or
several times in a semester, depending on course design and level. The information about the day, time, and
frequency of the Office Hours should be stated in the syllabus and Moodle of each course.

HOW to attend Office Hours?

Before the appointment:

Identify the purpose of visiting your professor, so that you use time meaningfully and well.

