3.1 If you do it by emailing to your professor:

● Introduce yourself first (name, surname, ID, course, year of study);
● Explain the reason for not being available at the scheduled time for Office Hours;
● Ask to make an appointment and offer a range of days and times that you are available;
● Thank your professor in advance and wait for the reply.

3.2 If you do it in person:

● Make sure your professor has the time to listen to you before or after the class;
● Introduce yourself first (name, surname, ID, course, year of study);
● Explain the reason for not being available at the scheduled times for office hours;
● Ask to make an alternative appointment and offer a range of days and times when you are

available;

● Thank your professor.

